        <>
        {/* 1. 배너모듈 */}
        <Main_Ban cat="main"/>
        {/* 2. 플레이어모듈 */}
        {ban_data.main.map((album, index) => (
            <Player album={album}/>
        ))}
        </>
    )
}

export default Main;
